    public static int lengthOfLongestSubstring(String s) {
        char[] ss = s.toCharArray();
        boolean [][] dp = new boolean[ss.length][ss.length];
        int maxLen = 0;
        for (int i = 0; i < ss.length; i++) {
            for (int j = i; j >= 0; j--) {
                if (i-j <= 0 || dp[j][i-1] && !s.substring(j, i).contains(ss[i]+"")) {
                    dp[j][i] = true;
                    if (i - j + 1 > maxLen) {
                        maxLen = i -j + 1;
                    }
                } else {
                    break;
                }
            }
        }
        return maxLen;
    }
